import React, { Component } from 'react';
import PortfolioItem from './PortfolioItem/Portfolioitem';
import PrevItemButton from './PrevItemButton/PrevItemButton';
import NextItemButton from './NextItemButton/NextItemButton';

import bg1 from './../../assets/img/agnes-bg.jpg';
import bg2 from './../../assets/img/wejsciowka-bg.jpg';
import bg3 from './../../assets/img/wa-bg.jpg';

class PortfolioListItems extends Component {
	constructor(props) {
		super(props);
		this.state = {
			PortfolioItems: [
				{
					id: 1,
					name: 'Agnes | Aplikacja mobilna + strona www',
					link: 'http://agnes-painkiller.com',
					backgroundImageURL: bg1,
					offset: 0
				},
				{
					id: 2,
					name: 'Wejściówka mobile app',
					link: 'www.google.pl',
					backgroundImageURL: bg2,
					offset: 0
				},
				{
					id: 3,
					name: 'What About - webdesign',
					link: 'www.google.pl',
					backgroundImageURL: bg3,
					offset: 0
				}
			]
		};
	}

	render() {
		return (
			<>
				<PrevItemButton />
				<div className="porfolio-items">
					{this.state.PortfolioItems.map(item => (
						<PortfolioItem
							key={item.id}
							name={item.name}
							link={item.link}
							backgroundImageURL={item.backgroundImageURL}
							offset={item.offset}
						/>
					))}
				</div>
				<NextItemButton />
			</>
		);
	}
}

export default PortfolioListItems;
